import React from "react";
import { Icon } from "Shared/svg/Icon";
import SimpleSlider from "Shared/PhotoSlider/SimpleSlider";
import {
  PhotoConteiner,
  SimpleSliderConteiner,
  BtnDesktop,
  VectorTop,
  MainConteiner,
  InfoConteiner,
  Name,
  Position,
} from "./style";
import Data from "Entites/Data";

export default function PersonPage() {
  const { person } = Data;
  return (
    <MainConteiner>
      <PhotoConteiner>
        <SimpleSliderConteiner>
          <SimpleSlider />
        </SimpleSliderConteiner>
        <BtnDesktop></BtnDesktop>
      </PhotoConteiner>
      <InfoConteiner>
        <Icon id="man" className="man" />
        <VectorTop />
        <Name></Name>
        <Position></Position>
      </InfoConteiner>
    </MainConteiner>
  );
}
